import React from 'react';
import { BrowserRouter, Link } from 'react-router-dom';
import Rotas from './Routes/Rotas'; // Certifique-se de que o caminho esteja correto
import AdicionarDesafio from './DataManipulation/AdicionarDesafio';

function App() {
  return (
    <BrowserRouter>
      <nav>
        <Link to='/home'>Home</Link>
        <Link to='/googleauth'>Google Auth</Link>
        <Link to='/adicionar'>Google Auth</Link>
      </nav>

      {/* Renderiza o componente de rotas */}
      <Rotas />
      <AdicionarDesafio />
    </BrowserRouter>
  );
}

export default App;
